class Solution:
    def diagonalSum(self, mat: List[List[int]]) -> int:
        n = len(mat)
        m = 0
        for i in range(n) :
            m += mat[i][i] + mat[i][n - i - 1]
        if n % 2 :
            w = n // 2
            m -= mat[w][w]
        return m

